// frontend/App.jsx
import React from 'react';
import FormularioEstudiante from './components/FormularioEstudiante';
import ListaEstudiantes from "./components/ListaEstudiantes";


function App() {
  return (
    <div>
      <h1>Registro de Estudiantes</h1>
      <FormularioEstudiante />
      <ListaEstudiantes />
    </div>
  );
}

export default App;
